import axios from "axios";

export const getReplyFromQn = async (qn: string) => {
  const res = await axios.get("http://127.0.0.1:5000/api/prompt", {
    params: {
      param_name: qn,
    },
  });
  console.log(res.data);
  return res.data;
};
